import styled from 'styled-components'

const activeInactiveButton = styled.button`
    border-radius: 10px;
    color: #FFFF;
    font-size: 16px;
    font-weight: 600;
    display: inline-flex;
    padding: 15px;
    transition: 0.3s;
`

export default activeInactiveButton
